import React from 'react';
import '../global.css';

const navLinks = [
  { label: 'Pricing', href: '#pricing' },
  { label: 'Services', href: '#services' },
  { label: 'Search', href: '#search' },
];

const Navbar = () => {
  return (
    <nav
      style={{
        width: '95%',
        margin: '1rem auto',
        background: 'rgba(255, 255, 255, 0.08)',
        color: '#fff',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '0 2.5rem',
        height: '88px',
        position: 'fixed',
        top: '0.5rem',
        left: '50%',
        transform: 'translateX(-50%)',
        zIndex: 1000,
        borderRadius: '1rem',
        backdropFilter: 'blur(14px)',
        WebkitBackdropFilter: 'blur(14px)',
        border: '1px solid rgba(255, 255, 255, 0.1)',
        boxShadow: 'none',
      }}
      className="poppins"
    >
      {/* Logo */}
      <div style={{ display: 'flex', alignItems: 'center', flex: 1 }}>
        <img
          src={require('../assets/logo.png')}
          alt="Logo"
          className="logo"
          style={{
            width: 120, // Extremely large logo
            height: 120,
            marginRight: '1.5rem',
            objectFit: 'contain',
          }}
        />
      </div>

      {/* Centered Nav Links */}
      <div
        style={{
          display: 'flex',
          flex: 2,
          justifyContent: 'center',
          alignItems: 'center',
          gap: '2.5rem',
        }}
      >
        {navLinks.map((link) => (
          <a
            key={link.label}
            href={link.href}
            style={{
              color: '#fff',
              fontWeight: 600,
              fontSize: '1.1rem',
              textDecoration: 'none',
              position: 'relative',
              padding: '0.25rem 0.5rem',
              borderRadius: '0.3rem',
              transition: 'border-bottom 0.2s ease',
            }}
            className="poppins nav-underline"
          >
            {link.label}
          </a>
        ))}
      </div>

      {/* Login Button */}
      <div style={{ flex: 1, display: 'flex', justifyContent: 'flex-end', marginRight: '3.5rem' }}>
        <a
          href="/login"
          style={{
            background: '#4DFF29',
            color: '#181818',
            fontWeight: 700,
            fontSize: '1.1rem',
            border: 'none',
            borderRadius: '0.5rem',
            padding: '0.75rem 2rem',
            cursor: 'pointer',
            textDecoration: 'none',
            transition: 'transform 0.25s ease, box-shadow 0.25s ease, background 0.25s ease',
          }}
          className="poppins login-popout"
        >
          Login
        </a>
      </div>

      <style>{`
        .nav-underline:hover {
          border-bottom: 4px solid #4DFF29;
        }

        .login-popout:hover {
          transform: scale(1.05);
          box-shadow: 0 0 14px #4DFF29, 0 0 8px rgba(77, 255, 41, 0.5);
          background: #3be622;
        }
      `}</style>
    </nav>
  );
};

export default Navbar;
